const Signup=()=>{
    const signupData=[{attr:"username",type:"text",id:"username",label:"Username:"},{attr:"phone_number",type:"Number",id:"phone_number",label:"Phone_Number:"},{attr:"email",type:"email",id:"email",label:"Email:"},{attr:"password",type:"password",id:"password",label:"Password:"}]
    return (
        <>
        <div>
            <form>
                {signupData.map((formkey)=>{
                    return (
                        <div>
                            <div>
                                <label for={formkey.id}>{formkey.label}</label>
                            </div>
                            <div>
                                <input type={formkey.type} id={formkey.id}/>
                            </div>
                        </div>
                    )
                })}
            </form>
        </div>
        </>
    )
}
export default Signup
